      let _this = this
      this.renderLabelImage(_this.imageIndex)
    }
  },
  methods: {       
    creatCanvas() {
      let _this = this
       _this.canvas = new fabric.Canvas('canvas', { selection: true, selectionColor:'rgba(100, 100, 255, 0.3)'       
      });
       fabric.Object.prototype.originX = fabric.Object.prototype.originY = 'center';
    },
  // function helper
    setCoundIdDefault() {
      let newId = 0
      let _this = this
      for (let i = 0; i < _this.fakeListStickman.length; i++) {
        if (_this.fakeListStickman[i].id >= newId) newId = _this.fakeListStickman[i].id +1
      }
      _this.countId = newId
    },
    setDefault() {
      let _this = this
      this.maxImage = this.fakebackendImage.length
      _this.labelDataset = new Array(_this.maxImage)
      _this.renderData = new Array(_this.maxImage)
      _this.fakeListImage = new Array(_this.maxImage)
      // call api to get all of stickman (set fakelistStickman = data return)
      // call api to get 20 images
      for (let i = 0; i<20;i++) {
        _this.fakeListImage[i] = {..._this.fakebackendImage[i]}
        _this.renderData[i] = _this.fakeListStickman.filter(ele => ele.imageId == _this.fakeListImage[i].id)
      }
      this.imageId = _this.fakeListImage[0].id
      this.imageIndex = 1
      this.setCoundIdDefault()
    },
    makeCircle(radius, left, top, line1, line2, line3, line4) {
        var c = new fabric.Circle({
          left: left,
          top: top,
          strokeWidth: 4,
          radius: radius,
          fill: '#fff',
          stroke: '#666',
          transparentCorners: false,
          hasBorders: false,
          hasControls: false,
          strokeUniform: true,
          lockScalingFlip: true
        });
        c.line1 = line1;
        c.line2 = line2;
        c.line3 = line3;
        c.line4 = line4;
        return c;
    },
    // function creat line
    makeLine(coords) {
        return new fabric.Line(coords, {
          fill: 'red',
          stroke: 'red',
          strokeWidth: 5,
          selectable: false,
          evented: true,
          strokeUniform: true,
          hasBorders: false,
        });     
    },
    // setBackground
    setBackgroundImage(url) {
      let _this = this
      _this.activeStickmanId = null
      _this.ImageURL = url
      var maxWidth = _this.canvas.width -100
      var maxHeight = _this.canvas.height -50 
        var  img = new Image();
        img.onload = function () {
          // set image center of canvas and limit size of image
          let imgWidth = this.width; // Current image width
          let imgHeight = this.height; // Current image height
          let widthAspectRatio = maxWidth / imgWidth;
          let heightAspectRatio = maxHeight / imgHeight;
          let finalAspectRatio = Math.min(widthAspectRatio, heightAspectRatio)
          let finalHeight = imgHeight * finalAspectRatio;
          let finalWidth = imgWidth * finalAspectRatio;
          let imgTop = (Math.round(_this.canvas.height) - Math.round(finalHeight)) / 2;        
          let imgLeft  = (Math.round(_this.canvas.width) - Math.round(finalWidth)) / 2;
          let nsgImage = new fabric.Image(img).scale(finalAspectRatio);    
          _this.canvas.setBackgroundImage(nsgImage, () => _this.canvas.renderAll(), {
            originX: 'left',
            originY: 'top',
            left: imgLeft, 
            top: imgTop
          })
        };
        img.src = _this.ImageURL;
    },
    redrawStickMan(listStickman) {
      if(!listStickman) return
      let _this = this
        _this.boundingBoxes = []  
        _this.boundingBoxes = listStickman.map(ele => {
          return {
            datasetId: ele.datasetId,
            imageId: ele.imageId,
            top: ele.top,
            left: ele.left,
            width: ele.width,
            height: ele.height,
            id: ele.id,
          }
        })
        for (let i = 0; i < listStickman.length; i++) {
            let line2 = _this.makeLine([listStickman[i].children[0].x1, listStickman[i].children[0].y1, listStickman[i].children[0].x2, listStickman[i].children[0].y2])
            let line3 = _this.makeLine([listStickman[i].children[1].x1, listStickman[i].children[1].y1, listStickman[i].children[1].x2, listStickman[i].children[1].y2])
            let line4 = _this.makeLine([listStickman[i].children[2].x1, listStickman[i].children[2].y1, listStickman[i].children[2].x2, listStickman[i].children[2].y2])
            let line5 = _this.makeLine([listStickman[i].children[3].x1, listStickman[i].children[3].y1, listStickman[i].children[3].x2, listStickman[i].children[3].y2])
            let Circle1 = _this.makeCircle(6, line2.get('x1'), line2.get('y1'), null, null, line2, line3)
            let Circle2 = _this.makeCircle(6, line2.get('x2'), line2.get('y2'), line2, line4)
            let Circle3 = _this.makeCircle(6, line3.get('x2'), line3.get('y2'), line3, line5)
            let Circle4 = _this.makeCircle(6, line4.get('x2'), line4.get('y2'), line4)
            let Circle5 = _this.makeCircle(6, line5.get('x2'), line5.get('y2'), line5)
            _this.canvas.add(line2, line3, line4, line5, Circle1, Circle2, Circle3, Circle4, Circle5,)
            _this.boundingBoxes[i].children = [line2, line3, line4, line5, Circle1, Circle2, Circle3, Circle4, Circle5]
        }
        _this.canvas.renderAll();
    },
    renderLabelImage(imageIndex) {
      let _this = this
      // let image = _this.fakeListImage.find(ele => ele.id == imageId)
      // let listStickman = _this.fakeListStickman.filter(ele => ele.imageId == imageId)
      let image = _this.fakeListImage[imageIndex-1]
      let listStickman = _this.renderData[imageIndex-1]
      console.log('hahahahah',_this.renderData ,listStickman)
      _this.setBackgroundImage(image.src)
      _this.canvas.clear()
      _this.redrawStickMan(listStickman)  
    },
    getCoordChildrenStickman(boundingBoxes) {
      boundingBoxes.map((ele) => {
        return {
          top: ele.top,
          left: ele.left,
          width: ele.width,
          height: ele.height,
          id: ele.id,
          children: ele.children.map((obj) => {
            if (obj.type == 'line') {
              return {
                type: obj.type,
                x1: obj.x1,
                y1: obj.y1,
                x2: obj.x2,
                y2: obj.y2,
              }
            }
            else {
              return {
                type: obj.type,
                top: obj.top,
                left: obj.left,
                radius: obj.radius
              }
            }
          })
        }
      })
    },
    // storage current image
    storageCurrentImage(imageIndex) {
