    // stickman
    stickman() {
      const _this = this 
      let canvas = _this.canvas
      var  isDrawing = false
      var origX, origY //point to get coordinate to creat default Stickman dynamic 
      var stickManObject =[]  // array to storage all cirlce and line of one stickman
      var isScalling = false
      var isMoving = false
      var isMovingCircle = false
      var isCreatingStickman = false
      const annotation = {
        datasetId: null,
        imageId: null,
        top: 0,
        left: 0,
        width: 0,
        height: 0,
        children: [],
      }    

    // function helper
      function isEnable() {
        return isDrawing 
      }
      function enable() {
       isDrawing = true
      }
      function disable() {
        isDrawing = false
      }  
      // disable rotating of stickman
      _this.canvas.on('selection:created', function () {
        const activeSelection = _this.canvas.getActiveObject()
        activeSelection.setControlsVisibility({ mtr: false });
      })
      _this.canvas.on('selection:updated', function () {
        const activeSelection = _this.canvas.getActiveObject()
        if (activeSelection.hasRotatingPoint) {
          activeSelection.setControlsVisibility({ mtr: false });
        }
      })

      // moving object
      _this.canvas.on('object:moving', function (e) {
        disable()
        // not handle move when size = 0
        if(e.target.width == 0 || e.target.height == 0){
          return ;
        } 
          var p = e.target;
          // move all stickman
          if (p.type == 'activeSelection') {
            isMoving = true
            for (let i = 0; i < p._objects.length; i++) {
              if(p._objects[i].type == 'circle') {
                p._objects[i].line1 && p._objects[i].line1.set({ 'x2': p.left + p._objects[i].left, 'y2': p.top + p._objects[i].top });
                p._objects[i].line2 && p._objects[i].line2.set({ 'x1': p.left + p._objects[i].left, 'y1': p.top + p._objects[i].top });
                p._objects[i].line3 && p._objects[i].line3.set({ 'x1': p.left + p._objects[i].left, 'y1': p.top + p._objects[i].top });
                p._objects[i].line4 && p._objects[i].line4.set({ 'x1': p.left + p._objects[i].left, 'y1': p.top + p._objects[i].top });
              }
            }
          } 
          // only move circle
          else {
            p.line1 && p.line1.set({ 'x2': p.left, 'y2': p.top });
            p.line2 && p.line2.set({ 'x1': p.left, 'y1': p.top });
            p.line3 && p.line3.set({ 'x1': p.left, 'y1': p.top });
            p.line4 && p.line4.set({ 'x1': p.left, 'y1': p.top });
            isMovingCircle = true
          }
        _this.canvas.renderAll();
      })
      
      // scaling 
      _this.canvas.on('object:scaling', function(e) {
        var p = e.target;
        if (p.type == 'activeSelection') {
          if (p.flipX == true || p.flipY == true) {
            p.flipX = false;
            p.flipY = false
          }
          isScalling = true
            for (let i = 0; i < p._objects.length; i++) {
              if(p._objects[i].type == 'circle') {
              // maintain size of circle while scalling
                var circle = p._objects[i],
                  group = p,
                  scaleX = group.width / (group.width * group.scaleX),  
                  scaleY = group.width / (group.width * group.scaleY);
                circle.set({
                  scaleX: scaleX,
                  scaleY: scaleY,
                })
                // set coor of line 
                p._objects[i].line1 && p._objects[i].line1.set({ 'x2': p.left + p._objects[i].left*group.scaleX, 'y2': p.top + p._objects[i].top*group.scaleY });
                p._objects[i].line2 && p._objects[i].line2.set({ 'x1': p.left + p._objects[i].left*group.scaleX, 'y1': p.top + p._objects[i].top*group.scaleY });
                p._objects[i].line3 && p._objects[i].line3.set({ 'x1': p.left + p._objects[i].left*group.scaleX, 'y1': p.top + p._objects[i].top*group.scaleY });
                p._objects[i].line4 && p._objects[i].line4.set({ 'x1': p.left + p._objects[i].left*group.scaleX, 'y1': p.top + p._objects[i].top*group.scaleY });
              }
            }
          } 
        _this.canvas.renderAll();
      }) 
      // mouse down
      _this.canvas.on('mouse:down', function (o) {
        var evt = o.e;
        if (evt.altKey === true) {
          this.isDragging = true;
          this.selection = false;
          this.lastPosX = evt.clientX;
          this.lastPosY = evt.clientY;
        }
        var pointer = _this.canvas.getPointer(o.e)
        if(_this.drawMode == 'stickman' && !evt.altKey) {
          
          // select stickman by click
          let stickmanSelection = _this.boundingBoxes.findLast(obj => (obj.top < pointer.y && (obj.top + obj.height > pointer.y)) && (obj.left < pointer.x && (obj.left + obj.width > pointer.x))) 
          if (!_this.canvas.getActiveObject()) {
            _this.activeStickmanId = null
            if(stickmanSelection) {
              var circle = stickmanSelection.children.filter(obj => obj.type == 'circle')
              var selection = new fabric.ActiveSelection(circle,
                {
                  canvas: _this.canvas,
                  lockRotation: true
                }
              );
              _this.canvas.setActiveObject(selection)
              _this.canvas.requestRenderAll();
              _this.activeStickmanId = stickmanSelection.id
            }
            
            else {
              // creat Stickman
                origX = pointer.x;
                origY = pointer.y;
                enable()
                let line2 = _this.makeLine([pointer.x, pointer.y, pointer.x, pointer.y])
                let line3 = _this.makeLine([pointer.x, pointer.y, pointer.x, pointer.y])
                let line4 = _this.makeLine([pointer.x, pointer.y, pointer.x, pointer.y])
                let line5 = _this.makeLine([pointer.x, pointer.y, pointer.x, pointer.y])
                let Circle1 = _this.makeCircle(0, line2.get('x1'), line2.get('y1'), null, null, line2, line3)
                let Circle2 = _this.makeCircle(0, line2.get('x2'), line2.get('y2'), line2, line4)
                let Circle3 = _this.makeCircle(0, line3.get('x2'), line3.get('y2'), line3, line5)
                let Circle4 = _this.makeCircle(0, line4.get('x2'), line4.get('y2'), line4)
                let Circle5 = _this.makeCircle(0, line5.get('x2'), line5.get('y2'), line5)
                _this.canvas.add(line2, line3, line4, line5, Circle1, Circle2, Circle3, Circle4, Circle5,)
                _this.canvas.discardActiveObject();
                var sel = new fabric.ActiveSelection([line2, line3, line4, line5, Circle1, Circle2, Circle3, Circle4, Circle5],
                {
                  canvas: _this.canvas,
                  lockRotation: true
                }
              );
              stickManObject = sel
            }
          }
          else {
          if(_this.canvas.getActiveObject().type == 'circle') {
            if(stickmanSelection) {
              _this.activeStickmanId = stickmanSelection.id
            }
          }
          }    
        }
      })
      // mouse move
      _this.canvas.on('mouse:move', function (o) {
        var pointer = _this.canvas.getPointer(o.e);
        if (this.isDragging) {
          var e = o.e;
          var vpt = this.viewportTransform;
          vpt[4] += e.clientX - this.lastPosX;
          vpt[5] += e.clientY - this.lastPosY;
          this.requestRenderAll();
          this.lastPosX = e.clientX;
          this.lastPosY = e.clientY;
        }
        if(_this.drawMode == 'stickman' && !o.e.altKey) {
          if (!isEnable()) return
          stickManObject.set({
            top: 0,
            left: 0
          })
          // creatStickMan dynamic
          let a = stickManObject._objects
          // var pointer = _this.canvas.getPointer(o.e);
          a[0].set({
            x1: origX + (pointer.x - origX) * 50 / 100,
            y1: origY > pointer.y ?  origY +  (pointer.y - origY) * 60 / 100 :  origY +  (pointer.y - origY) * 40 / 100,
            x2: origX > pointer.x ? origX + (pointer.x - origX) * 75 / 100 : origX + (pointer.x - origX) * 25 / 100,
            y2: origY > pointer.y ?  origY +  (pointer.y - origY) * 100 / 100 :  origY +  (pointer.y - origY) * 0 / 100,
          })
          a[1].set({
            x1: origX + (pointer.x - origX) * 50 / 100,
            y1: origY > pointer.y ?  origY +  (pointer.y - origY) * 60 / 100 : origY + (pointer.y - origY) * 40 / 100,
            x2: origX > pointer.x ?origX +(pointer.x - origX) * 25 / 100 :origX +(pointer.x - origX) * 75 / 100,
            y2: origY > pointer.y ?  origY +  (pointer.y - origY) * 100 / 100 :  origY +  (pointer.y - origY) * 0 / 100,
          })
          a[2].set({
            x1: origX > pointer.x ? origX + (pointer.x - origX) * 75 / 100 :origX +  (pointer.x - origX) * 25 / 100,
            y1: origY > pointer.y ?  origY +  (pointer.y - origY) * 100 / 100 :  origY +  (pointer.y - origY) * 0 / 100,
            x2: origX > pointer.x ? origX + (pointer.x - origX) * 100 / 100 : origX + (pointer.x - origX) * 0 / 100,
            y2: origY > pointer.y ?  origY +  (pointer.y - origY) * 0 / 100 :  origY +  (pointer.y - origY) * 100 / 100,
          })
          a[3].set({
            x1: origX > pointer.x ? origX + (pointer.x - origX) * 25 / 100 : origX + (pointer.x - origX) * 75 / 100,
            y1: origY > pointer.y ?  origY +  (pointer.y - origY) * 100 / 100 :  origY +  (pointer.y - origY) * 0 / 100,
            x2: origX > pointer.x ? origX + (pointer.x - origX) * 0 / 100 : origX + (pointer.x - origX) * 100 / 100,
            y2: origY > pointer.y ?  origY +  (pointer.y - origY) * 0 / 100 :  origY +  (pointer.y - origY) * 100 / 100,
          })
          a[4].set({
            left: a[0].get('x1'),
            top: a[0].get('y1'),
            radius: 6,
          })
          a[5].set({
            left: a[0].get('x2'),
            top: a[0].get('y2'),
            radius: 6,
          })
          a[6].set({
            left: a[1].get('x2'),     
            top: a[1].get('y2'),
            radius: 6,
          })
          a[7].set({
            left: a[2].get('x2'),
            top: a[2].get('y2'),
            radius: 6,
          })
          a[8].set({
            left: a[3].get('x2'),
            top: a[3].get('y2'),
            radius: 6,
          })
          a.map(x => {
            x.setCoords();
          })  
          _this.canvas.renderAll();
          isCreatingStickman = true
        }
      });
    // mouse wheel: zoom in zoom out
      _this.canvas.on('mouse:wheel', function (opt) {
        var delta = opt.e.deltaY;
        var zoom = canvas.getZoom();
        zoom *= 0.999 ** delta;
        if (zoom > 20) zoom = 20;
        if (zoom < 0.01) zoom = 0.01;
        canvas.zoomToPoint({ x: opt.e.offsetX, y: opt.e.offsetY }, zoom);
        opt.e.preventDefault();
        opt.e.stopPropagation();
      });
    // mouse up
      _this.canvas.on('mouse:up', function () {
        this.setViewportTransform(this.viewportTransform);
        this.isDragging = false;
        this.selection = true;    
          if(_this.drawMode == 'stickman') {
            if(enable) {
              disable()
            }
          }
          if(isScalling) {
            if(_this.canvas.getActiveObject()) {
              let activeObjects = _this.canvas.getActiveObject()._objects
              _this.canvas.discardActiveObject();
              var circle = activeObjects.filter(obj => obj.type == 'circle')
              var sel = new fabric.ActiveSelection(circle,
                {
                  canvas: _this.canvas,
                  lockRotation: true
                }
              );
              _this.canvas.setActiveObject(sel)
              _this.canvas.requestRenderAll();
              let stickManActiveIndex = _this.boundingBoxes.findIndex((ele) => ele.id == _this.activeStickmanId)   
              _this.boundingBoxes[stickManActiveIndex].width = _this.canvas.getActiveObject().width
              _this.boundingBoxes[stickManActiveIndex].height = _this.canvas.getActiveObject().height
              _this.boundingBoxes[stickManActiveIndex].top = _this.canvas.getActiveObject().top - _this.canvas.getActiveObject().height/2
              _this.boundingBoxes[stickManActiveIndex].left = _this.canvas.getActiveObject().left - _this.canvas.getActiveObject().width/2
              isScalling = false
            }
          }
          if (isMoving) {
            let stickManActiveIndex = _this.boundingBoxes.findIndex((ele) => ele.id == _this.activeStickmanId)   
              _this.boundingBoxes[stickManActiveIndex].width = _this.canvas.getActiveObject().width
              _this.boundingBoxes[stickManActiveIndex].height = _this.canvas.getActiveObject().height
              _this.boundingBoxes[stickManActiveIndex].top = _this.canvas.getActiveObject().top - _this.canvas.getActiveObject().height/2
              _this.boundingBoxes[stickManActiveIndex].left = _this.canvas.getActiveObject().left - _this.canvas.getActiveObject().width/2
              isMoving = false
          }
          if(isMovingCircle) {
            let stickManActiveIndex = _this.boundingBoxes.findIndex((ele) => ele.id == _this.activeStickmanId)  

            
            let circle = _this.boundingBoxes[stickManActiveIndex].children.filter(obj => obj.type == 'circle')
              let sel = new fabric.ActiveSelection(circle,
                {
                  canvas: _this.canvas,
                  lockRotation: true
                }
              );
              _this.canvas.setActiveObject(sel)
              _this.boundingBoxes[stickManActiveIndex].width = _this.canvas.getActiveObject().width
              _this.boundingBoxes[stickManActiveIndex].height = _this.canvas.getActiveObject().height
              _this.boundingBoxes[stickManActiveIndex].top = _this.canvas.getActiveObject().top - _this.canvas.getActiveObject().height/2
              _this.boundingBoxes[stickManActiveIndex].left = _this.canvas.getActiveObject().left - _this.canvas.getActiveObject().width/2
              _this.canvas.discardActiveObject();
              _this.canvas.requestRenderAll();
              _this.activeStickmanId = null
              isMovingCircle = false
          } else {
            if(_this.canvas.getActiveObject() && _this.canvas.getActiveObject().type == 'circle') {
            _this.activeStickmanId = null
          }
          }
          if(isCreatingStickman) {
            // storage coordinate of stickman when just created
            if(_this.canvas.getActiveObject()) {
              const box = Object.create(annotation);
              box.datasetId = _this.fakeListImage[_this.imageIndex-1].datasetId
              box.imageId = _this.imageId
              box.width = _this.canvas.getActiveObject().width;
              box.height = _this.canvas.getActiveObject().height;
              box.left = _this.canvas.getActiveObject().left - _this.canvas.getActiveObject().width/2;
              box.top = _this.canvas.getActiveObject().top-_this.canvas.getActiveObject().height/2;
              box.id = _this.countId; 
              box.children = [...stickManObject._objects]
              _this.boundingBoxes.push(box)
              _this.activeStickmanId = _this.countId
              let stickmanJustDraw = _this.boundingBoxes.find((ele) => {
                return ele.id == _this.activeStickmanId
              })
              _this.choseStickMan(stickmanJustDraw)
              _this.countId++
            }
            isCreatingStickman = false
          }
      });       
    },
  },
}
</script>

